import React, { Component } from 'react'
import { Link } from 'react-router-dom';
import dataCar from "./carsData/carsData.json";
import './this'



export class Audi extends Component {



    // componentDidMount() {
    //     fetch('audiImgs/cars.json')
    //         .then(function(resp){
    //             return resp.json();
    //         })
    //         .then(function(data){
    //             console.log(data);
    //         })
    // }



    render() {

        /* Set the width of the side navigation to 250px and the left margin of the page content to 250px and add a black background color to body */
        function openNav() {
            var sideNav = document.getElementById("mySidenav");
            var main = document.getElementById("main");
            var body = document.body;

            mySidenav.style.width = "250px";
            main.style.marginLeft = "250px";
            body.style.backgroundColor = "rgba(0,0,0,0.4)";
        }

        /* Set the width of the side navigation to 0 and the left margin of the page content to 0, and the background color of body to white */
        function closeNav() {
            var main = document.getElementById("main");
            var body = document.body;

            mySidenav.style.width = "0";
            main.style.marginLeft = "0";
            body.style.backgroundColor = "white";
        }

        return (


            <div className="container mb-3">

                <div id="mySidenav" class="sidenav">
                    <a href="javascript:void(0)" class="closebtn" onclick="closeNav()">&times;</a>
                    <a href="#">About</a>
                    <a href="#">Services</a>
                    <a href="#">Clients</a>
                    <a href="#">Contact</a>
                </div>

                <button onclick={openNav}>open</button>
                <h1 className="mb-5 pb-5">Latest Added Cars :</h1>
                {dataCar.map(cdata => (
                    <Link to={"/Car" + cdata.Link} className="row cars-sel mb-2" style={{ textDecoration: 'none' }}>
                        <img src={cdata.img} alt={cdata.name} style={{ borderRadius: '8px' }} className="col-lg-3" />
                        <div className="col-lg-9">
                            <h3>{cdata.name}</h3>
                            <p>{cdata.price}</p>
                            <p>{cdata.Reviews}</p>
                        </div>
                    </Link>
                ))}
            </div>
        )
    }
}

export default Audi
